def predict(triples: list[Triple]) -> str:
    sentence = ""
    facts = []

    for triple in triples:
        if triple.predicate == "cityServed":
            facts.append(f"{triple.subject} serves the city of {triple.object}")
        elif triple.predicate == "country":
            facts.append(f"{triple.subject} is in {triple.object}")
        elif triple.predicate == "elevationAboveTheSeaLevel":
            facts.append(f"{triple.subject} has an elevation of {triple.object} meters")
        elif triple.predicate == "location":
            facts.append(f"{triple.subject} is located in {triple.object}")
        elif triple.predicate == "runwayLength":
            facts.append(f"{triple.subject} has a runway length of {triple.object} meters")
        elif triple.predicate == "1stRunwayLengthFeet":
            facts.append(f"The first runway length of {triple.subject} is {triple.object} feet")
        elif triple.predicate == "iataLocationIdentifier":
            facts.append(f"The IATA identifier of {triple.subject} is {triple.object}")
        elif triple.predicate == "nativeName":
            facts.append(f"{triple.subject} is also known as {triple.object}")
        elif triple.predicate == "capital":
            facts.append(f"The capital of {triple.subject} is {triple.object}")
        elif triple.predicate == "officialLanguage":
            facts.append(f"The official language of {triple.subject} is {triple.object}")
        elif triple.predicate == "largestCity":
            facts.append(f"The largest city of {triple.subject} is {triple.object}")

    if facts:
        sentence = ", ".join(facts) + "."
    else:
        sentence = "Information unavailable."

    return sentence

